description:
300 DWARVES is the tale of an epic dwarven mercenary band with axes for hire to anyone willing to pay in gold or treasure. When the once peaceful kingdom is attacked by the green horde it's up to you to prepare its defense. Thus begins the epic journey to save the world from the green menace! As the dwarven commander, you will lead the band into battle. The choices you make will decide whether your dwarves make it or not. As an old dwarven proverb says: What is better than a big axe? An even bigger axe! A classic tower defense game, featuring beautiful, hand drawn graphics, animations and rich, captivating storyline 300 Dwarves offers a variety of unique towers, upgrades, and special powers as you travel the diverse lands of the kingdom. Face off against small goblins, tough orcs, and a menagerie of other creatures and enemies in this hilarious twist on tower defense that features challenging levels and intense gameplay that can thwart even the most skilled strategist.
